import {useState } from 'react'

const Room = () => {
    // using state for components
    const  [users, setUsers] = useState([
        { username: "User1"},
        { username: "User2" },
        { username: "User3" } 
    ])

    setUsers([...users, {username: "User4"}])
  return (
      //to change state you have to use the function
    //   setUsers([...users, {username: "User4"}])
    <div>
        {users.map( (user) => (<h3 key={user.username}>{user.username}</h3>) )}
    </div>
  )
}

export default Room
